class Operation_parking(Req):

    """使用激活码注册并登陆运营商"""
    # def __init__(self, host="https://mgr.k8s.yidianting.com.cn"):
    #     self.host = host
    #     self.S = requests.session()

    def validateActivationCode(self, cooperativeAccount):
        """获取激活码"""
        getIdsql = "SELECT id FROM cooperative_user WHERE  cooperative_account = '{}'".format(cooperativeAccount)
        cooperative__id = Db().select(getIdsql)

        getCodesql = "SELECT activation_code FROM cooperative_activation_code WHERE cooperativeUser_id ={} " \
              "ORDER BY id ASC LIMIT 1".format(cooperative__id)
        activationCode = Db().select(getCodesql)
        print("activationCode****", activationCode)


        """检查激活码"""
        self.url = "/mgr/normal/ajax/validateActivationCode.do"
        data = {
            "code": "{}".format(activationCode)
        }
        r = self.post(self.api, data)
        print("检查激活码----")
        print(activationCode)
        print(r.text)

    def validAndregister_User(self, cooperativeAccount, userAccount):
        """校验用户名
        @cooperativeAccount: 合作商账号，可随机
        @userAccount： 注册运营商的账号，即pomp登陆账号，可随机
        """
        self.url = "/mgr/normal/ajax/validUser.do"
        data = {
            "loginId": "{}".format(userAccount)
        }
        r = self.post(self.api, data)
        print("校验用户名----")
        print(r.text)

        """注册运营商"""

        """获取激活码"""
        getIdsql = "SELECT id FROM cooperative_user WHERE  cooperative_account = '{}'".format(cooperativeAccount)
        cooperative__id = Db().select(getIdsql)

        getCodesql = "SELECT activation_code FROM cooperative_activation_code WHERE cooperativeUser_id ={} " \
                     "ORDER BY id ASC LIMIT 1".format(cooperative__id)
        activationCode = Db().select(getCodesql)
        print("activationCode****", activationCode)

        self.url = "/mgr/normal/ajax/registerUser.do"
        data = {
            "managerName": "运营商{}".format(SuperAction().get_time()),
            "userAccount": "{}".format(userAccount),
            "firstPwd": "999999",
            "confirmPwd": "999999",
            "activationCode": "{}".format(activationCode)
        }
        r = self.post(self.api, data)
        s = json.loads(r.text)
        print(s)

